import React from 'react';
import { Navbar, Nav, Container, NavItem, Tabs, Tab } from 'react-bootstrap';
import {Link} from "react-router-dom";
import AddProduct from './AddProduct';
import AddUser from './AddUser';
import ChangeProduct from './ChangeProduct';
import ChangeUser from './ChangeUser';
import RemoveProduct from './RemoveProduct';
import RemoveUser from './RemoveUser';
import { useLocation } from 'react-router-dom';

export default function AdminUi(props) {

    const location = useLocation();
    const params = new URLSearchParams(location.hash);

    console.log(JSON.stringify([...params.entries()]));
    console.log(...params);

    return(
        <div className="main">
        <Navbar bg="light" expand="lg">
        <Container>
            <Navbar.Brand href="#home">React-Bootstrap</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
                <Nav className="me-auto" type="tabs">
                    <Nav.Link href="#home">add User</Nav.Link>
                    <Nav.Link href="#link">remove User</Nav.Link>
                    <Nav.Link href="#link">change User</Nav.Link>
                    <Nav.Link href="#link">add Product</Nav.Link>
                    <Nav.Link href="#link">remove Product</Nav.Link>
                    <Nav.Link href="#link">change Product</Nav.Link>
                
                </Nav>
            </Navbar.Collapse>
        </Container>
        </Navbar>
        <Tabs defaultActiveKey="profile" id="uncontrolled-tab-example" className="mb-3">
            <Tab eventKey="home" title="Home">
                <AddUser />
            </Tab>
            <Tab eventKey="profile" title="Profile">
                <RemoveUser />
            </Tab>
            <Tab eventKey="contact" title="Contact" disabled>
                <ChangeUser />
            </Tab>
        </Tabs>
            <Link to="/">{"back"}</Link><br />
            
            
            <AddUser />
            <RemoveUser />
            <ChangeUser />
            <AddProduct />
            <RemoveProduct />
            <ChangeProduct />
        </div>
        
    );
}
